embedfield:
Spring Data MongoDB document expiry time<p>I've set up a simple document model (below) along with a Spring Data repository</p>

<pre><code>@Document(collection = "users")
public class UserDocument {

    @Id
    private String userId;

    @Indexed(expireAfterSeconds=3600)
    private LocalDateTime registeredDate;
}
</code></pre>

<p>This seems to work fine and deletes the user documents after whatever time I set <code>expireAfterSeconds</code> to. However, rather than typing in a value of 3600 I'd like to pull that number from a config .yml. The usual way of adding <code>@Value("${config.file.path.of.expiry}")</code> won't work because <code>@Indexed</code>requires the value to be a runtime constant, which @Value isn't.</p>

<p>Is there any other way to set up document expiry dates in Spring/Mongodb that doesn't use <code>@Indexed(expireAfterSeconds=x)</code>?</p>

