MongoDB return subTotal and total in a single query<p>I have this data in a collection:</p>

<pre><code>{id:1, types:{'A':4, 'B': 3, 'C':12}}
{id:1, types:{'A':8, 'B': 2, 'C':11}}
{id:2, types:{'A':7, 'B': 6, 'C':14}}
{id:3, types:{'A':1, 'B': 9, 'C':15}}
</code></pre>

<p>I want to query for the total of each <strong>type</strong> for <strong>id:1</strong> but I also want to know the totals for each <strong>type</strong> for all <strong>id</strong>s in a single query. I would like the output to look something like this:</p>

<pre><code>{id:1, types:{'A':12, 'B':5, 'C':12, 'sumA':20,'sumB':20,'sumC':52}}
</code></pre>

<p>I can do this by calling 2 separate queries. One query containing</p>

<pre><code> {$match: {id:1}}
</code></pre>

<p>And one that does not have a $match option. But I would like to know if it can be done in a single query.</p>

<p>Edit: types A,B and C are dynamic so I won't know the values beforehand.</p>

<p>Thanks!</p>

