embedfield:
Mongoose child objects added to parent object not saved correctly<p>I have a Schema called Players and another one called Game. Every Games has an attribute called players which is an array of references to player objects.</p>
<p>Game Schema</p>
<pre><code>let GameSchema = new mongoose.Schema({
    players: [{
        ref: &quot;Player&quot;,
        type: mongoose.Schema.Types.ObjectId,
    }],
    created: {
        type: Date,
        default: Date.now,
    }
}, { usePushEach: true });
</code></pre>
<p>PlayerSchema</p>
<pre><code>let PlayerSchema = new mongoose.Schema({
    parentGameId: mongoose.Schema.Types.ObjectId,
    idInGame: Number,
    points: Number,
});
</code></pre>
<p>MongoDb Connection</p>
<pre><code>mongoose.Promise = global.Promise;
mongoose.connect(&quot;mongodb://localhost/ScoreKeeper&quot;, { useMongoClient: true });
</code></pre>
<p>Code for initializing Games and Players on the post route. (I am using Express)</p>
<pre><code>app.post('/', function(req, res) {
    let players = Number(req.body.players);
    Game.create({
        players: [],
    }, function(error, newGame) {
        if (error) {
            console.log(error);
        } else {
            let currentGameID = newGame._id;
            for (let i = 1; i &lt;= players; i++) {
                Player.create({
                    parentGameId: currentGameID,
                    idInGame: i,
                    points: 0
                }, function(error, newPlayer) {
                    if (error) {
                        console.log(error);
                    } else {  
                        newGame.players.push(newPlayer._id);
                        newGame.save(function(error, newGame) {
                            if (error) {
                                console.log(error);
                            } else {
                                console.log(&quot;New Player added&quot;);
                            }
                        });

                    }
                });
            }
        }

    });
});
</code></pre>
<p>On Terminal on the node console I have the following output, when I create 5 players:</p>
<blockquote>
<p>New Player added</p>
<p>New Player added</p>
<p>New Player added</p>
<p>New Player added</p>
<p>New Player added</p>
</blockquote>
<p>Now when I go to the mongo console and check out the players collection, I find there are 5 players created as expected. Using &quot;db.players.find()&quot;</p>
<blockquote>
<p>{ &quot;_id&quot; : ObjectId(&quot;5a6159685d3dabb00d0065b0&quot;), &quot;parentGameId&quot; : ObjectId(&quot;5a6159685d3dabb00d0065af&quot;), &quot;idInGame&quot; : 1, &quot;points&quot; : 0, &quot;__v&quot; : 0 }</p>
<p>{ &quot;_id&quot; : ObjectId(&quot;5a6159685d3dabb00d0065b1&quot;), &quot;parentGameId&quot; : ObjectId(&quot;5a6159685d3dabb00d0065af&quot;), &quot;idInGame&quot; : 2, &quot;points&quot; : 0, &quot;__v&quot; : 0 }</p>
<p>{ &quot;_id&quot; : ObjectId(&quot;5a6159685d3dabb00d0065b2&quot;), &quot;parentGameId&quot; : ObjectId(&quot;5a6159685d3dabb00d0065af&quot;), &quot;idInGame&quot; : 3, &quot;points&quot; : 0, &quot;__v&quot; : 0 }</p>
<p>{ &quot;_id&quot; : ObjectId(&quot;5a6159685d3dabb00d0065b3&quot;), &quot;parentGameId&quot; : ObjectId(&quot;5a6159685d3dabb00d0065af&quot;), &quot;idInGame&quot; : 4, &quot;points&quot; : 0, &quot;__v&quot; : 0 }</p>
<p>{ &quot;_id&quot; : ObjectId(&quot;5a6159685d3dabb00d0065b4&quot;), &quot;parentGameId&quot; : ObjectId(&quot;5a6159685d3dabb00d0065af&quot;), &quot;idInGame&quot; : 5, &quot;points&quot; : 0, &quot;__v&quot; : 0 }</p>
</blockquote>
<p>However when I check the game object in the mongo console, I find this ...</p>
<blockquote>
<p>db.games.findOne()</p>
<p>{</p>
<pre><code>&quot;_id&quot; : ObjectId(&quot;5a6159685d3dabb00d0065af&quot;),

&quot;created&quot; : ISODate(&quot;2018-01-19T02:35:20.632Z&quot;),

&quot;players&quot; : [

    ObjectId(&quot;5a6159685d3dabb00d0065b1&quot;),

    ObjectId(&quot;5a6159685d3dabb00d0065b1&quot;),

    ObjectId(&quot;5a6159685d3dabb00d0065b0&quot;),

    ObjectId(&quot;5a6159685d3dabb00d0065b1&quot;),

    ObjectId(&quot;5a6159685d3dabb00d0065b0&quot;),

    ObjectId(&quot;5a6159685d3dabb00d0065b2&quot;),

    ObjectId(&quot;5a6159685d3dabb00d0065b3&quot;),

    ObjectId(&quot;5a6159685d3dabb00d0065b3&quot;),

    ObjectId(&quot;5a6159685d3dabb00d0065b4&quot;)

],

&quot;__v&quot; : 5
</code></pre>
<p>}</p>
</blockquote>
<p>There is a mismatch between Games and Players, I feel that the bug is in saving the <code>newGame</code> after adding <code>newPlayer</code>. Strangely enough <code>_v</code> property reads 5 as expected. Could you please point me towards fixing the bug?</p>
<p>Thank-you</p>

