Mongodb $count aggregation pipeline not found<p>I'm trying to build an aggregation pipeline in Mongo to count the number of documents generated every 10 minutes in a fairly large dataset.  Each document contains an ISODate in a field called requestDtsCal.  I'm trying the following code (thanks to <a href="https://stackoverflow.com/users/3943271/wizard">https://stackoverflow.com/users/3943271/wizard</a> for the base code):</p>

<pre><code>var baseDate = new Date(2017, 01, 11, 00, 00, 0);
var startDate = new Date(2017, 01, 11, 00, 00, 0);
var endDate = new Date(2018, 09, 20, 14, 25, 0);
var divisor = 10 * 60 * 1000; // 10 minutes in miliseconds

db.AUDIT.aggregate([ 
    {
        $match : {
            requestDtsCal : {
                $gte : startDate,
                $lt : endDate
            }
        }
    }, {
        $group : {
            _id : {
                $subtract : [ "$requestDtsCal", {
                    $mod : [ {
                        $subtract : [ "$requestDtsCal", baseDate ]
                    }, divisor ]
                } ]
            },
            dates : {
                $push : "$requestDtsCal"
            }
        }
    }, {
        $count: "$requestDtsCal"
    } 
]).pretty();
</code></pre>

<p>If I run it without the last pipeline stage it returns an array of arrays of all the dates from each document within each range.  As soon as I try and count the number of documents in each range with the last pipeline stage it fails with:</p>

<pre><code>assert: command failed: {
    "ok" : 0,
    "errmsg" : "Unrecognized pipeline stage name: '$count'",
    "code" : 16436
} : aggregate failed
_getErrorWithCode@src/mongo/shell/utils.js:25:13
doassert@src/mongo/shell/assert.js:16:14
assert.commandWorked@src/mongo/shell/assert.js:403:5
