How to have relate two collections that have a one-to-one relationship<p>I have 0 experience with NoSQL databases and it is hard to not come up with a "SQL solution" to this problem. I have a Restaurant, which obviously has an address. My first idea was to simply put a lot of fields such as country, city, zip, line1, etc... However I thought that referencing it to an Address document, giving me the flexibility to easily change the structure of Addresses, so after a little bit of research I came up with this:</p>

<pre><code>var RestaurantSchema = new mongoose.Schema({
    name: {
        type: String,
        required: true
    },
    address: {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Address',
        required: true
    },
    // a few more fields
    createdAt: {type: Date, default: Date.now},
    updatedAt: {type: Date, default: Date.now},
});

var AddressSchema = new mongoose.Schema({
    restaurant: {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Restaurant'
    },
    line1: {
        type: String,
        required: true
    },
    line2: {
        type: String,
    }
    // etc
    createdAt: {type: Date, default: Date.now},
    updatedAt: {type: Date, default: Date.now},
});
</code></pre>

<p>My question comes after wondering how I would do if I wanted to retrieve all restaurants from a city, for example, I'd do something like find('Houston') and then get each Restaurant from each id referenced by the Addresses retrieved?</p>

<p>I feel like there's a better way to do this but at the moment I don't even know what else to search trying to find an answer.</p>

