Get unique object by key in MongoDB driver<p>I want to get distinct object based on some key. Here is how I do it in mongodb:</p>

<pre><code>db.collection.aggregate(
   [
     { $match: filter },
     {
        $group:
        {
           _id: distinctField,
           value: { $first: "$$ROOT" } // taking any of group because we don't care
        }
     },
     { $replaceRoot : { newRoot: "$value" }}
   ]
)
</code></pre>

<p>it works as expected. But then I try to do it in C#:</p>

<pre><code>public static IAggregateFluent&lt;T&gt; WhereDistinct&lt;T, TKey&gt;(this IMongoCollection&lt;T&gt; collection, FilterDefinition&lt;T&gt; filter, Expression&lt;Func&lt;T, TKey&gt;&gt; distinctField) =&gt; 
    collection.Aggregate()
            .Match(filter)
            .Group(distinctField, items =&gt; new { Value = items.FirstOrDefault() }) // taking any of group because we don't care
            .ReplaceRoot(arg =&gt; arg.Value);
</code></pre>

<p>And I get an exception:</p>

<blockquote>
  <p>Additional information: FirstOrDefault of type System.Linq.Enumerable
  is not supported in the expression tree {document}.OrderByDescending(c
  => c.Version).FirstOrDefault().</p>
</blockquote>

<p>Is it possible to do it without creating nasty <code>BsonDocument</code> query? I know I just can manually write the whole thing, but I'd like to use some linq-pased approach.</p>

